.html {
 position: absolute;
 top: 50%;
 left: 0;
 right: 0;
 text-align: center;
 z-index: -2;
 opacity:0.75;
 font-size:20rem;
}

widgets.onValue:
for (var i in value) {
    value[i] = Math.max(0, Math.min(1, value[i]))
}

set("this", value, {sync: false, send: false})

widgets.onTouch:
if (event.type == "start") {
 locals.x = event.offsetX / width
 locals.y = 1 - value[parseInt(locals.x * value.length)]
} else {
 locals.x += event.movementX / width
 locals.y = (1 - value[parseInt(locals.x * value.length)] + event.movementY / height)
}

var n = parseInt(locals.x * value.length)
n = Math.max(0, Math.min(n, value.length-1))

value[n] = 1 - locals.y

set("this", value)
var val
if(event.type == 'start'){
send('/touch_multiFader_9',1)
} else if(event.type == 'stop'){
send('/touch_multiFader_9',0)
}

